import React from "react";
import { ringOptions, basePrice } from "../data/ringOptions";

// Generate a small set of demo products (all combinations would be too many)
const demoProducts = [
  {
    id: "solitaire-white-gold-round",
    name: "Classic Solitaire in White Gold (Round)",
    image: ringOptions.designs[0].image,
    price: basePrice + ringOptions.metals[0].price + ringOptions.designs[0].price + ringOptions.shapes[0].price + ringOptions.carats[0].price,
    metal: ringOptions.metals[0].name,
    design: ringOptions.designs[0].name,
    shape: ringOptions.shapes[0].name,
  },
  {
    id: "halo-yellow-gold-princess",
    name: "Halo Setting in Yellow Gold (Princess)",
    image: ringOptions.designs[1].image,
    price: basePrice + ringOptions.metals[1].price + ringOptions.designs[1].price + ringOptions.shapes[1].price + ringOptions.carats[0].price,
    metal: ringOptions.metals[1].name,
    design: ringOptions.designs[1].name,
    shape: ringOptions.shapes[1].name,
  },
  {
    id: "vintage-platinum-emerald",
    name: "Vintage Platinum (Emerald Cut)",
    image: ringOptions.designs[2].image,
    price: basePrice + ringOptions.metals[3].price + ringOptions.designs[2].price + ringOptions.shapes[2].price + ringOptions.carats[0].price,
    metal: ringOptions.metals[3].name,
    design: ringOptions.designs[2].name,
    shape: ringOptions.shapes[2].name,
  },
  {
    id: "three-stone-rose-gold-oval",
    name: "Three Stone in Rose Gold (Oval)",
    image: ringOptions.designs[3].image,
    price: basePrice + ringOptions.metals[2].price + ringOptions.designs[3].price + ringOptions.shapes[3].price + ringOptions.carats[0].price,
    metal: ringOptions.metals[2].name,
    design: ringOptions.designs[3].name,
    shape: ringOptions.shapes[3].name,
  },
];

const Shop = () => (
  <div className="bg-white min-h-screen font-sans px-4 py-12 luxury-bg">
    <h1 className="text-4xl font-serif font-bold text-gold mb-10 text-center tracking-tight luxury-glow" style={{ fontFamily: 'Playfair Display, serif' }}>
      Shop All Rings
    </h1>
    {/* Filters (static for now) */}
    <div className="flex flex-wrap gap-4 justify-center mb-12 bg-white/60 backdrop-blur-lg rounded-2xl shadow-elegant border border-gold/20 p-6 luxury-card">
      <select className="border border-gold rounded-full px-5 py-2 text-black bg-white focus:outline-gold shadow-soft">
        <option>All Metals</option>
        {ringOptions.metals.map(m => <option key={m.id}>{m.name}</option>)}
      </select>
      <select className="border border-gold rounded-full px-5 py-2 text-black bg-white focus:outline-gold shadow-soft">
        <option>All Designs</option>
        {ringOptions.designs.map(d => <option key={d.id}>{d.name}</option>)}
      </select>
      <select className="border border-gold rounded-full px-5 py-2 text-black bg-white focus:outline-gold shadow-soft">
        <option>All Shapes</option>
        {ringOptions.shapes.map(s => <option key={s.id}>{s.name}</option>)}
      </select>
    </div>
    <div className="h-1 w-32 mx-auto bg-gradient-to-r from-gold to-gold-dark rounded-full mb-12 opacity-60 luxury-shimmer" />
    {/* Product Grid */}
    <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-4 gap-10 max-w-6xl mx-auto bg-white/60 backdrop-blur-lg rounded-3xl shadow-elegant border border-gold/20 p-10">
      {demoProducts.map(product => (
        <div key={product.id} className="bg-white/90 rounded-2xl shadow-elegant p-6 border-2 border-gold flex flex-col items-center hover:scale-105 hover:shadow-2xl hover:border-gold-dark transition-all duration-200 cursor-pointer luxury-card">
          <img src={product.image} alt={product.name} className="w-28 h-28 object-cover rounded-full mb-5 border-4 border-gold shadow-inner" />
          <div className="font-serif text-lg font-bold mb-1 text-center luxury-glow" style={{ fontFamily: 'Playfair Display, serif' }}>{product.name}</div>
          <div className="text-gold-dark text-base mb-3 font-semibold">${product.price.toLocaleString()}</div>
          <a href={`/product/${product.id}`} className="inline-block mt-auto px-6 py-2 bg-gradient-to-r from-gold to-gold-dark text-black font-bold rounded-full shadow hover:from-gold-dark hover:to-gold transition text-sm tracking-wide luxury-shimmer">View Details</a>
        </div>
      ))}
    </div>
    <style>{`
      .luxury-bg {
        background: repeating-linear-gradient(135deg, #fff 0 40px, #f5e7b2 40px 80px);
      }
      .luxury-glow {
        text-shadow: 0 2px 12px #bfa14a99, 0 1px 0 #fff;
      }
      .luxury-shimmer {
        background-size: 200% 200%;
        animation: shimmer 2.5s linear infinite;
      }
      @keyframes shimmer {
        0% { background-position: 0% 50%; }
        100% { background-position: 100% 50%; }
      }
      .luxury-card {
        transition: box-shadow 0.3s, transform 0.3s;
      }
      .luxury-card:hover {
        box-shadow: 0 8px 32px 0 #bfa14a33, 0 1.5px 6px 0 #bfa14a22;
        border-color: #bfa14a;
      }
    `}</style>
  </div>
);

export default Shop;
